import Card from '../card/Card.jsx';
import './cardlist.css';

const MOCK_DATA = [
  {id: 1, title: '한글', content: 'Korean' },
  {id: 2, title: '영어', content: 'English' },
  {id: 3, title: '호주', content: 'Australia' },
];

const CardList = () => {

  <section>
    {
    MOCK_DATA.map((card)=> (
      <Card key={card.id} title={card.title} content={card.content}/>
    ))
    }
  </section>

}

export default CardList;
